comment: | # preserve newlines
    KEK-KEKB.  Measurement of the differential cross section for the process GAMMA GAMMA --> K0S K0S in the W range 1.05-4.00 GeV.  The analysis uses a data sample of intergated luminosity 972 fb-1 from  the KEKB asymmetric-energy collider operated at and near the Upsilon resonance region.  As well as the differential cross sections as a function of cos(theta) covering the whole W range, the integrated cross sections as a  function of W are given for two lower cos(theta) cut-offs.
additional_resources:

